      <div className={`card-container ${index}`} key={id}>
        <img
          alt={`monster ${name}`}
          src={`https://robohash.org/${key + 3}?size=150x200`}
        />
        <h2>{name}</h2>
        <p>{email}</p>
      </div>
    );
  }
}

export default CardContainer;
